cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model Inner_Loop_Controller_PI_controller_1

equation
	freeze_xi = Flipflop(((pre(xi)>=ymax) and (yin*Ki>0)) or ((pre(xi)<=-ymax) and (yin*Ki<0)), ((pre(xi)<ymax) or ((pre(xi)>=ymax) and (yin*Ki<0))) and ((pre(xi)>-ymax) or ((pre(xi)<=-ymax) and (yin*Ki>0))));
	der(xi) = Select(freeze_xi, 0.0, yin*Ki);            // Freeze integrator if outside limits
	yout = Kp*yin+LimConst(xi,-ymax,ymax);

end Inner_Loop_Controller_PI_controller_1;

function Flipflop
	input  Boolean set;
	input  Boolean reset;
	output Boolean state;
algorithm
	if (set = true) and (reset = false) then
		state := true;
	end if;
	if (set = false) and (reset = true) then
		state := false;
	end if;	
end Flipflop;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function LimConst
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end LimConst;

model Inner_Loop_Controller_Activate_Gain_2

equation
	yo = Selfix(Enable,(K*yi),0);

end Inner_Loop_Controller_Activate_Gain_2;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

model Inner_Loop_Controller_PI_controller_3

equation
	freeze_xi = Selfix(Balanced(), 1, Flipflop(Selfix(Balanced(), 1, ((pre(xi)>=ymax) and (yin*Ki>0)) or ((pre(xi)<=-ymax) and (yin*Ki<0))), Selfix(Balanced(), 0, ((pre(xi)<ymax) or ((pre(xi)>=ymax) and (yin*Ki<0))) and ((pre(xi)>-ymax) or ((pre(xi)<=-ymax) and (yin*Ki>0))))));
	der(xi)  = Selfix(Balanced(), 0.0, Select(freeze_xi, 0.0, yin*Ki));          // Freeze integrator if outside limits
	yout = Selfix(Balanced(), 0.0, Kp*yin+LimConst(xi,-ymax,ymax));

end Inner_Loop_Controller_PI_controller_3;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Flipflop
	input  Boolean boolset;
	input  Boolean boolreset;
	output Boolean state;
algorithm
	if (boolset = true) and (boolreset = false) then
		state := true;
	end if;
	if (boolset = false) and (boolreset = true) then
		state := false;
	end if;	
end Flipflop;

function Balanced
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for Balanced RMS, 2 for unBalanced RMS, 3 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end Balanced;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function LimConst
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end LimConst;

